INSERT INTO `categories` (`id`, `name`, `slug`, `description`) VALUES
(1, 'Tiên Hiệp', 'tien-hiep', 'Truyện tiên hiệp thường kể về quá trình tu luyện và khám phá thế giới tu sĩ thần tiên đầy bí ẩn của nhân vật chính.'),
(2, 'Kiếm Hiệp', 'kiem-hiep', 'Truyện thường xoay quanh cuộc đời của nhân vật chính, quá trình rèn luyện, trưởng thành, tìm kiếm, học tập các bí kíp võ công, cùng những cuộc phiêu lưu, truy đuổi, chém giết... đầy nguy hiểm và cơ hội trong giới võ lâm giang hồ.'),
(3, 'Ngôn Tình', 'ngon-tinh', 'Truyện thuộc kiểu lãng mạn, kể về những sự kiện vui buồn trong tình yêu của nhân vật chính.'),
(4, 'Truyện Teen', 'truyen-teen', 'Truyện dành cho lứa tuổi mới lớn'),
(5, 'Đô Thị', 'do-thi', 'Những truyện có nội dung chủ yếu diễn ra trong môi trường đô thị hiện đại.'),
(6, 'Quân Sự', 'quan-su', 'Truyện có yếu tố quân sự, thường diễn ra trong môi trường quân đội, quân lính.'),
(7, 'Lịch Sử', 'lich-su', 'Nội dung truyện thường xảy ra trong lịch sử, có nhiều yếu tố tương tự so với lịch sử thế giới thật.'),
(8, 'Xuyên Không', 'xuyen-khong', 'Xuyên Không, Xuyên Việt là thể loại nhân vật chính vì một lý do nào đó mà bị đưa đến sinh sống ở một không gian hay một khoảng thời gian khác.\r\n\r\nNhân vật chính có thể trực tiếp xuyên qua bằng thân xác mình hoặc sống lại bằng thân xác người khác.'),
(9, 'Truyện Ma', 'truyen-ma', 'Một câu chuyện ma có thể là bất kỳ tiểu thuyết, hoặc kịch, bao gồm một con ma, hoặc đơn giản là làm tiền đề cho khả năng của ma hoặc niềm tin của nhân vật vào chúng.'),
(10, 'Trinh Thám', 'trinh-tham', 'Tiểu thuyết lấy đề tài là những chuyện ly kỳ trong cuộc đấu tranh giữa những nhà trinh sát với kẻ địch.'),
(11, 'Huyền Huyễn', 'huyen-huyen', 'Truyện có những yếu tố huyền bí, khoa học khó giải thích.'),
(12, 'Khoa Huyễn', 'khoa-huyen', 'Những bộ truyện có yếu tố khoa học bí ẩn.'),
(13, 'Dị Giới', 'di-gioi', 'Trong truyện có xuất hiện những thế giới kỳ dị, khác với thế giới chúng ta đang sinh sống.'),
(14, 'Võng Du', 'vong-du', 'Là thể loại truyện thuộc dạng khoa học viễn tượng, lấy bối cảnh thường là các game online trên mạng với công nghệ cao, hình ảnh chất lượng cao, kỹ xảo đồ sộ, mức chân thật cao, kỳ ảo, và tác giả của thể loại này thường rất giàu trí tưởng tượng.'),
(15, 'Tiểu Thuyết', 'tieu-thuyet', 'Tiểu thuyết là một thể loại văn xuôi có hư cấu, thông qua nhân vật, hoàn cảnh, sự việc để phản ánh bức tranh xã hội rộng lớn và những vấn đề của cuộc sống con người, biểu hiện tính chất tường thuật, tính chất kể chuyện bằng ngôn ngữ văn xuôi theo những chủ đề xác định.'),
(16, 'Khác', 'khac', 'Tổng hợp epub truyện hay nhất miễn phí.');
